import React from 'react';
import Stars from './Stars';
import RatingSelector from './RatingSelector';

export default function Movie(props){
    return (
        <li className="movie-group-item">
            {props.item.title}
            <RatingSelector
            rating={props.item.rating}
            onChange={(newRating) => props.updateRating(props.item.id, newRating)}/>
            <Stars rating={props.item.rating} />
            <button className="btn btn-sm btn-danger float-end" onClick={() => {props.deleteMovie(props.item.id)}}>X</button>
        </li>
    )
}
